import React, {Component} from 'react';
import User from './User'

class Users extends Component{
    render(){
        state = {
            users :[
                {
                    name: 'A'
                },
                {
                    name: 'B'
                }
            ]
        }
        return(
           <div>
               <User>{this.state.users[0].name}</User>
           </div>
        )
    }
}
export default Users
